  this._createButon23D = function () {
    var bodymaterial = new BABYLON.StandardMaterial('bodyMaterial', this.scene)
    // bodymaterial.diffuseColor = new BABYLON.Color3(0.3, 0.3, 0.3)
    bodymaterial.diffuseTexture = new DrawText(this.scene, this.metadata['text'].name, this.metadata['text'].settings)

    const box = this.body
    box.scaling.x = parseFloat(this.metadata['dimensions']['d_max_body_span'])
    box.scaling.y = parseFloat(this.metadata['dimensions']['maximum_height'])
    box.scaling.z = parseFloat(this.metadata['dimensions']['e_max_body_span'])

    box.material = bodymaterial

    this._addPinsButon2Comp(box)

    box.material = bodymaterial

    this._createButon22D(box)

    // create an empty mesh to hold the entire components
    var mesh = new BABYLON.Mesh('mesh', this.scene)
    mesh.name = 'Buton2' // this.metadata['name'] + this.metadata['part'] + this.metadata['id']
    box.setParent(mesh)

    return mesh
  }

